Journeying through the alphabet, a showcase of music 
from across the world - from Africa to Uzbekistan, Norway 
to South America, India to Louisiana and everywhere in
between.

Featured instruments include Kimmo Pohjonen's accordion, 
the impressively large drums of the Yamato Drummers and 
the extraordinary vocals of Nusrat Fateh Ali Khan. The 
helter-skelter ride takes us from the 1970s, through to 
the explosion of acts in the 1980s, right up to the most 
sought-after musicians on the world music circuit today.

From Sevara Nazarkhan's pin-drop solo to a crowd-moving 
set from Orchestra Baobab, this is a compilation that 
presents a fun, vibrant snapshot of the range of 
traditional music that has captured audiences the world 
over.
